import React from 'react';
import Header from './Header'
import Finder from './Finder'
import Router from './Router'
import Emergency from './Emergency'
import Footer from './Footer'
import '../styles/menu.css';
//import { Header, Finder, Router, Emergency, Footer} from '../modules'

class Menu extends React.Component {

    render() {
        return (
            <div id="menu">
                <Header />
                <div id="controller">
                    <Finder 
                        findRoomId={this.props.findRoomId}
                        handleChangeFinder={this.props.handleChangeFinder}
                        handleSubmitFinder={this.props.handleSubmitFinder}
                    />
                    <Router 
                        sourceRoomId={this.sourceRoomId}
                        handleChangeRouterSource={this.handleChangeRouterSource}
                        destinationRoomId={this.destinationRoomId}
                        handleChangeRouterDestination={this.handleChangeRouterDestination}
                        handleSubmitRouter={this.handleSubmitRouter}
                    />
                    <Emergency />
                </div>
                <Footer />
            </div>)
    }
}

export default Menu
